"""
Different implementations of quicksort number sorting algorithm:
quicksort1: book "Grokking algorithms" by A.Bhargava - chapter 4, page 92
mergesortish_quicksort: StackOverflow v01: https://stackoverflow.com/posts/18262384/revisions
"""

from timeit import default_timer as timer

from exec_time import display_function_execution_time as elapsed


def quicksort1(lst):
    if len(lst) <= 1:
        return lst
    pivot = lst[0]
    less = [i for i in lst[1:] if i <= pivot]
    greater = [i for i in lst[1:] if i > pivot]
    return quicksort1(less) + [pivot] + quicksort1(greater)


def mergesortish_quicksort(lst):
    less = []
    equal = []
    greater = []

    if len(lst) > 1:
        pivot = lst[0]
        for x in lst:
            if x == pivot:
                equal.append(x)
            elif x < pivot:
                less.append(x)
            elif x > pivot:
                greater.append(x)
        return mergesortish_quicksort(less) + equal + mergesortish_quicksort(greater)
    else:
        return lst




